    # Function to calculate number of ways to reach a step
    def count_ways(n):
        if n <= 1:
            return 1
        elif n == 2:
            return 2
        else:
            return count_ways(n - 1) + count_ways(n - 2) + count_ways(n - 3)

    # Total ways to reach the 4th step
    ways_to_4 = count_ways(4)
    # Total ways to reach the 10th step without considering the muddy 5th step
    ways_to_10 = count_ways(10)

    # Since Jimmy can't step on the 5th step, we consider 10th step as 9th step
    # and multiply the number of ways to get to the 4th step with the number of ways
    # to go from the 5th to the 10th step treating it as going from the 4th to the 9th.
    ans = ways_to_4 * (ways_to_10 - ways_to_4)

    return ans

