from sympy import divisors

def solution():
    # hcf is the product of the shared prime factors to their shared powers
    hcf = 3**1 * 5**2

    # Define the function to determine the number of factors for a given power of 3 and 5
    def find_number_of_factors(power_of_3, power_of_5):
        # The number of divisors of a number is the product of (exponent+1) of its prime factors
        return (power_of_3 + 1) * (power_of_5 + 1)

    # Searching for M and N given their number of factors and HCF
    # First, list the possible exponents for 3 and 5 given their number of factors
    possible_m_3_power = []
    possible_m_5_power = []
    possible_n_3_power = []
    possible_n_5_power = []

    # Fill in the possible powers for M (12 divisors) and N (10 divisors) based on the number of divisors formula
    for i in range(12):
        for j in range(12):
            if find_number_of_factors(i, j) == 12:
                possible_m_3_power.append(i)
                possible_m_5_power.append(j)
    for i in range(10):
        for j in range(10):
            if find_number_of_factors(i, j) == 10:
                possible_n_3_power.append(i)
                possible_n_5_power.append(j)

    # Find M and N based on the possible powers and their HCF
    # Since HCF is 75, we know that the shared powers of 3 and 5 are (3^1, 5^2)
    M, N = 0, 0
    for i in range(len(possible_m_3_power)):
        for j in range(len(possible_n_3_power)):
            candidate_M = 3**possible_m_3_power[i] * 5**possible_m_5_power[i]
            candidate_N = 3**possible_n_3_power[j] * 5**possible_n_5_power[j]
            # Check if the HCF of M and N is 75
            if hcf * candidate_M // 75 == candidate_N // 75 == hcf:
                M, N = candidate_M, candidate_N
                break
        if M and N:
            break

    return M + N

ans = solution()

