def solution():
    # Define a function to calculate ways to reach a certain step
    def ways_to_step(n):
        # Base cases: 1 way to reach step 0 and 1 way to reach step 1
        if n == 0 or n == 1:
            return 1
        # Recursive case: ways to reach previous step + ways to reach two steps before
        else:
            return ways_to_step(n - 1) + ways_to_step(n - 2)

    # Calculate the ways to reach the 5th step
    ways_to_5 = ways_to_step(5)
    # Calculate the ways to reach the 10th step from the 5th step
    ways_to_10_from_5 = ways_to_step(10 - 5)

    # Total ways is the product of the ways to reach the 5th step and the ways to reach the 10th from there
    return ways_to_5 * ways_to_10_from_5

ans = solution()

