    from math import gcd

    # We look for the largest possible sum, which means we should start from the largest 3-digit numbers
    # that satisfy the condition of having two equal digits and being divisible by 75. Numbers divisible
    # by 75 have to end with 25 or 50 so the last two digits are already fixed.

    largest_sum = 0  # initialize largest sum

    # Iterate over the range of possible hundreds-digits
    for i in range(9, 0, -1):
        # Check combinations with two equal digits
        for d1 in range(9, -1, -1):
            A = int(f"{i}{d1}{d1}")
            if A % 75 != 0:
                continue

            # Check for the other number with two digits that could be the same as in A
            for j in range(i, -1, -1):
                for d2 in range(9, -1, -1):
                    B = int(f"{j}{d2}{d2}")
                    if B % 75 != 0 or A == B:
                        continue

                    # Since the question stipulates they must have a gcd of 75, we check for that
                    if gcd(A, B) == 75:
                        # Update the largest sum if we find a larger one
                        largest_sum = max(largest_sum, A + B)

    return largest_sum

