    def num_factors(n):
        factors_count = 0
        for i in range(1, int(n ** 0.5) + 1):
            if n % i == 0:
                factors_count += 1 if i == n // i else 2
        return factors_count

    count = 0
    # All multiples of 15 can be represented as 15 * k
    # We need only to check the numbers of the form 15 * k have exactly 15 factors
    # k must start from 1
    k = 1
    while True:
        multiple = 15 * k
        if num_factors(multiple) == 15:
            count += 1
        # If the multiple has more than 15 factors, since factors grow with k, we can stop
        if num_factors(multiple) > 15:
            break
        k += 1
    return count

