def solution():
    # Calculate the number of ways to reach the 5th step
    # It's similar to Fibonacci sequence
    def ways_to_reach(n):
        if n == 1:
            return 1
        elif n == 2:
            return 2
        else:
            return ways_to_reach(n-1) + ways_to_reach(n-2)

    # Ways to reach the 5th step
    ways_to_5 = ways_to_reach(5)
    # Ways to reach the 10th step from the 5th step (like starting from the first step to reach the 6th as there are 5 more steps)
    ways_from_5_to_10 = ways_to_reach(6)

    # The total number of ways to climb to the 10th step, stepping on the 5th step
    total_ways = ways_to_5 * ways_from_5_to_10

    return total_ways

