def solution():
    num = 33 * 55
    m = 1

    # Factorize num and count the number of each prime number
    prime_factors = {}
    for i in range(2, int(math.sqrt(num)) + 1):
        while num % i == 0:
            num = num // i
            if i in prime_factors:
                prime_factors[i] += 1
            else:
                prime_factors[i] = 1

    # If num is still greater than one, it must be a prime number
    if num > 1:
        prime_factors[num] = 1

    # Find the smallest m by making sure each prime factor's count is even
    for prime in prime_factors:
        count = prime_factors[prime]
        if count % 2 != 0:
            m *= prime

    return m

