from sympy import *

def solution():
    # Define factorial function
    def factorial(n):
        if n == 0:
            return 1
        else:
            return n * factorial(n-1)

    # Define subfactorial function for derangement
    def subfactorial(n):
        if n == 0:
            return 1
        elif n == 1:
            return 0
        else:
            return (n - 1) * (subfactorial(n - 1) + subfactorial(n - 2))

    # Calculate the number of ways six papers can be mixed up
    # so that none of the students gets their own paper
    ways = subfactorial(6)

    return ways

