    from itertools import combinations
    from math import prod
    from sympy import factorint

    numbers = set(range(1, 14))

    # Find the numbers with a unique count of factors, which the two students might have.
    unique_factors = {}
    for number in numbers:
        factors_count = len(factorint(number))
        if factors_count not in unique_factors:
            unique_factors[factors_count] = {number}
        else:
            unique_factors[factors_count].add(number)
    unique_factors = {k: v for k, v in unique_factors.items() if len(v) == 1}

    # Possible combinations of 9 numbers
    possible_combinations = combinations(numbers, 9)

    for combo in possible_combinations:
        # Convert the combo to a sorted list
        sorted_combo = sorted(combo)
        # Check if we have numbers with unique factor count
        hands_raised = [n for n in sorted_combo if len(factorint(n)) in unique_factors] 

        # If exactly two students know their numbers, proceed
        if len(hands_raised) == 2:
            for i in range(1, len(sorted_combo)):
                # Alice's number is odd, hence index i must contain an odd number
                alice = sorted_combo[i]
                # May's number is smaller than Alice's by 2
                may = alice - 2
                # May's number should be bigger than Mark's by 1, so Mark is may - 1
                mark = may - 1

                # Check if May and Mark's numbers are in the combo (sorted list)
                if may in sorted_combo and mark in sorted_combo:
